// GetItems.js
import React, { useState, useEffect } from 'react';
import ItemApi from './ItemApi';

const GetItems = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    ItemApi.getAllItems().then((data) => setItems(data));
  }, []);

  return (
    <div>
      <h2>Get All Items</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {items.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.name}</td>
              <td>{item.price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default GetItems;
